import { useContext } from "react"
import { NetContaxt } from "./NetflixFile"
import './All.css'

function NetFlix (){
    const contaxt = useContext(NetContaxt)
    console.log(contaxt);
    return (
        <div className="main">
            <h1>{contaxt.title}</h1>
            <p>{contaxt.para}</p>
        </div>
    )
}
export default NetFlix
